pragma solidity ^0.8.25;

import '@openzeppelin/contracts/token/ERC20/ERC20.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import './interfaces/IUniswapV2Router02.sol';

contract Insai is ERC20, Ownable {
  // WETH
  address public immutable WETH;

  // Addresses exempt from fees
  mapping(address => bool) public isExemptFromFee;

  // Fees
  uint256 public buyStandardFee = 40; // 4%
  uint256 public sellStandardFee = 40; // 4%
  uint256 public buyBurnFee = 10; // 1%
  uint256 public sellBurnFee = 10; // 1%
  uint256 public minimumBalanceToSwap = 100_000 ether; // 0.1% of total supply
  address public feeRecipient;

  // Pair addresses
  mapping(address => bool) public isPair;

  // Router
  IUniswapV2Router02 public uniswapV2Router;

  // Swapping fees
  bool public swapping;
  bool public swapEnabled = true;

  // Maximum per wallet
  uint256 public maxPerWallet = 2_000_000 ether; // 2% of total supply
  mapping(address => bool) public isExemptFromMax;

  // Trading enabled
  bool public tradingEnabled;

  // Modifier to prevent multiple swaps from occurring at once
  modifier lockSwap() {
    swapping = true;
    _;
    swapping = false;
  }

  constructor(address _uniswapV2Router, address _feeRecipient, address _weth) ERC20('InsightAI', 'INSAI') Ownable(msg.sender) {
    // Set WETH
    WETH = _weth;

    // Exempt addresses from fees
    isExemptFromFee[address(this)] = true;
    isExemptFromFee[msg.sender] = true;
    isExemptFromFee[_feeRecipient] = true;

    // Set addresses as exempt from max
    isExemptFromMax[address(this)] = true;
    isExemptFromMax[msg.sender] = true;
    isExemptFromMax[_feeRecipient] = true;

    // Set addresses
    uniswapV2Router = IUniswapV2Router02(_uniswapV2Router);
    feeRecipient = _feeRecipient;

    // Mint 100M tokens to the deployer
    _mint(msg.sender, 100_000_000 ether);
  }

  // _update override to apply fees
  function _update(address from, address to, uint256 value) internal override {
    // Trading must be enabled
    require(tradingEnabled || from == owner() || to == owner(), 'Trading not enabled');

    // If fee is applicable, calculate and send it to the contract
    // Pair == from: buy transaction
    if (isPair[from] && !isExemptFromFee[to]) {
      // Calculate standard fee
      uint256 standardFee = (value * buyStandardFee) / 1000;

      // Update balances directly
      super._update(from, address(this), standardFee);

      // Calculate burn fee
      uint256 burnFee = (value * buyBurnFee) / 1000;

      // Burn tokens directly
      super._update(from, address(0), burnFee);

      // Update value
      value -= standardFee + burnFee;
    }
    // Pair == to: sell transaction
    else if (isPair[to] && !isExemptFromFee[from]) {
      // Calculate standard fee
      uint256 standardFee = (value * sellStandardFee) / 1000;

      // Update balances directly
      super._update(from, address(this), standardFee);

      // Calculate burn fee
      uint256 burnFee = (value * sellBurnFee) / 1000;

      // Burn tokens directly
      super._update(from, address(0), burnFee);

      // Update value
      value -= standardFee + burnFee;
    }

    // Max per wallet logic. Does not apply if the sender is the owner
    if (!isExemptFromMax[to] && from != owner()) {
      require(balanceOf(to) + value <= maxPerWallet, 'Max per wallet exceeded');
    }

    // Swapping logic
    if (swapEnabled && !swapping) {
      // Get contract balance
      uint256 contractBalance = balanceOf(address(this));

      // Swap for ETH if the contract balance is greater than the minimum balance to swap
      if (contractBalance >= minimumBalanceToSwap) {
        swapTokensForEth(contractBalance);
      }
    }

    // Super call to update the balance
    super._update(from, to, value);
  }

  // Swap contract balance for ETH. Locks the swap to prevent reentrancy
  function swapTokensForEth(uint256 tokenAmount) internal lockSwap {
    // Generate the uniswap pair path of token -> weth
    address[] memory path = new address[](2);
    path[0] = address(this);
    path[1] = WETH;

    // Approve the maximum amount if it hasn't been approved yet
    if (allowance(address(this), address(uniswapV2Router)) < type(uint256).max) {
      _approve(address(this), address(uniswapV2Router), type(uint256).max);
    }

    // Perform the swap & send the ETH to the fee recipient
    uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
      tokenAmount,
      0, // Accept any amount of ETH
      path,
      feeRecipient,
      block.timestamp + 10 minutes
    );
  }

  // Manual swap function, only callable by the owner
  function manualSwap(uint256 amount) external onlyOwner {
    require(!swapping, 'Swapping in progress');
    require(amount > 0, 'Amount must be greater than 0');
    require(amount <= balanceOf(address(this)), 'Insufficient balance');

    // Swap tokens for ETH
    swapTokensForEth(amount);
  }

  // Same as above, but swaps the entire balance
  function manualSwapAll() external onlyOwner {
    require(!swapping, 'Swapping in progress');
    require(balanceOf(address(this)) > 0, 'Cannot swap 0 tokens');

    // Swap tokens for ETH
    swapTokensForEth(balanceOf(address(this)));
  }

  // Enables withdrawing fees when swap is disabled
  function withdrawFees() external onlyOwner {
    require(!swapEnabled, 'Cannot withdraw fees when swap is enabled');

    // Get contract balance
    uint256 contractBalance = balanceOf(address(this));

    // Transfer the balance to the owner
    _transfer(address(this), feeRecipient, contractBalance);
  }

  // Update the buy standard fee
  function setBuyStandardFee(uint256 _buyStandardFee) external onlyOwner {
    require(_buyStandardFee <= 200, 'Fee must be less than or equal to 200');
    buyStandardFee = _buyStandardFee;
  }

  // Update the sell standard fee
  function setSellStandardFee(uint256 _sellStandardFee) external onlyOwner {
    require(_sellStandardFee <= 200, 'Fee must be less than or equal to 200');
    sellStandardFee = _sellStandardFee;
  }

  // Update the buy burn fee
  function setBuyBurnFee(uint256 _buyBurnFee) external onlyOwner {
    require(_buyBurnFee <= 200, 'Fee must be less than or equal to 200');
    buyBurnFee = _buyBurnFee;
  }

  // Update the sell burn fee
  function setSellBurnFee(uint256 _sellBurnFee) external onlyOwner {
    require(_sellBurnFee <= 200, 'Fee must be less than or equal to 200');
    sellBurnFee = _sellBurnFee;
  }

  // Exempt an address from fees
  function setExemptFromFee(address _address, bool _exempt) external onlyOwner {
    isExemptFromFee[_address] = _exempt;
  }

  // Add or remove a pair
  function setPair(address _pair, bool _isPair) external onlyOwner {
    isPair[_pair] = _isPair;
  }

  // Enable / disable swapping
  function setSwapEnabled(bool _swapEnabled) external onlyOwner {
    swapEnabled = _swapEnabled;
  }

  // Set minimum balance to swap
  function setMinimumBalanceToSwap(uint256 _minimumBalanceToSwap) external onlyOwner {
    minimumBalanceToSwap = _minimumBalanceToSwap;
  }

  // Set maximum percentage per wallet
  function setMaxPerWallet(uint256 _maxPerWallet) external onlyOwner {
    maxPerWallet = _maxPerWallet;
  }

  // Exempt an address from max
  function setExemptFromMax(address _address, bool _exempt) external onlyOwner {
    isExemptFromMax[_address] = _exempt;
  }

  // Enable trading
  function enableTrading(address _uniswapPair) external onlyOwner {
    // Mark trading as enabled
    tradingEnabled = true;

    // Mark the pair as such
    isPair[_uniswapPair] = true;

    // Exclude the INSAI/ETH pair from max per wallet
    isExemptFromMax[_uniswapPair] = true;
  }

  // Set the fee recipient
  function setFeeRecipient(address _feeRecipient) external onlyOwner {
    feeRecipient = _feeRecipient;
  }
}
